import React from 'react'
import Precart from './Precart/Precart';
import ProductsCart from './ProductsCart/ProductsCart';
import s from './Cart.module.css'

export default function Cart({cart_products}) {
  return (
    <div className={[s.cart_elements, 'bg-white dark:bg-black'].join(' ')}>
      <h1 className={[s.empty_cart, 'h2'].join(' ')}>Shopping cart</h1>

      <div className={s.elements}>
        <Precart cart_products={cart_products} />
        {!cart_products && <ProductsCart />}
      </div>
  </div>
  )
}
